[vc_row tm_bgimagefixed="" css=".vc_custom_1533399575967{padding-top: 65px !important;padding-bottom: 60px !important;}"][vc_column][tm-custom-heading text="Frequently Asked Questions" font_container="tag:h2|font_size:36px|text_align:left|line_height:46px" el_class="tm-textcolor-skincolor"][vc_column_text]Below you’ll find answers to some of the most frequently asked questions at PresentUp. We are constantly adding most asked question to this page so if you have a question and don’t see your answer, don’t hesitate to email us at info@example.com[/vc_column_text][vc_tta_accordion color="grey" gap="20" active_section="1"][vc_tta_section title="What can PresentUp Events do for an Event?" tab_id="1533396882102-15df988c-ee5b7fbd-fe2c"][vc_column_text]PresentUp Events specializes in the planning of corporate, social and non-profit events. This includes birthday, celebration parties, employee events, conferences or meetings, weddings, bridal showers and more! We have different and creative approach to bring your dreams to a reality.[/vc_column_text][/vc_tta_section][vc_tta_section title="How far will you travel for an Event?" tab_id="1533396882141-f4e83ff9-08ff7fbd-fe2c"][vc_column_text]Since launching the company, we have helped to host events throughout the different state and even helped to coordinate an event overseas for one client. Many of our clients are in the different region.[/vc_column_text][/vc_tta_section][vc_tta_section title="How Can I Contact You?" tab_id="1533397427840-523d2361-d3287fbd-fe2c"][vc_column_text]Please visit contact us page for all your queries and redressal of grievances. You can also contact us on +12 (3) 4567 899 number.[/vc_column_text][/vc_tta_section][vc_tta_section title="What happens if an Event is cancelled?" tab_id="1533397591990-9dd742b0-768c7fbd-fe2c"][vc_column_text]Sometimes the unexpected happens and you need to cancel your Event make sure you call us or email us before 10 day ago before cancellation.[/vc_column_text][/vc_tta_section][vc_tta_section title="How early should you start planning an event?" tab_id="1533397820292-167ebe6e-b8fd7fbd-fe2c"][vc_column_text]Depending on the event, most will start planning at least 1 months in advance. For large-scale events that span over multiple 12+ months to plan. Our team has also planned and schedule celebrations everythings. Our advice would be to start as early as possible.[/vc_column_text][/vc_tta_section][vc_tta_section title="Do you charge separately for your various event services?" tab_id="1533397978258-198e3019-cc287fbd-fe2c"][vc_column_text]Some of our services come standard, others are priced separately. In order to get an idea of what your event will cost, contact us to speak with one of our event planner. They can give you a free estimate based on your individual needs.[/vc_column_text][/vc_tta_section][vc_tta_section title="If someone wants to get started planning an event, what should they do?" tab_id="1533398082683-9877f66e-88837fbd-fe2c"][vc_column_text]Call us on or visit our office. We will sit down with you to talk about next steps and how our  team can help build your dreams so that you can enjoy the event—stress free![/vc_column_text][/vc_tta_section][/vc_tta_accordion][/vc_column][/vc_row]
TMCONTENTTILLTHIS;
